import React from 'react';
import './Header.css';

function Header({ cart }) {
  return (
    <header className="header">
      <h1>My Store</h1>
      <div className="cart">
        <span>Cart: {cart.length} items</span>
      </div>
    </header>
  );
}

export default Header;
